import React from "react";

function App() {
  return (
    <div>
      <form>
        <label htmlFor="userName"></label>
        <input type="text" id="userName"></input>
        <label htmlFor="age"></label>
        <input type="number" id="age"></input>
      </form>
    </div>
  );
}

export default App;
